️ WooCommerce mencoba menginstal <a href="%1$s">plugin REST API Lawas</a> karena situs ini telah <a href="%2$s">menggunakan REST API Lawas</a> atau telah <a href="%3$s">menentukan webhook lawas</a>, tetapi proses instalnya gagal (lihat detail error di <a href="%4$s">log WooCommerce</a>). Instal dan aktifkan plugin secara manual. <a href="%5$s">Informasi selengkapnya</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ WooCommerce mencoba menginstal dan mengaktifkan <a href="%1$s">plugin REST API Lawas</a> karena situs ini telah <a href="%2$s">menggunakan REST API Lawas</a> atau telah <a href="%3$s">menentukan webhook lawas</a>. <a href="%4$s">Informasi selengkapnya</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce berhasil menginstal plugin REST API Lawas, tetapi gagal mengaktifkannya. Lihat konteks untuk penjelasan lebih lanjut.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce menginstal <a href="%1$s">plugin REST API Lawas</a> karena situs ini telah <a href="%2$s">menggunakan REST API Lawas</a> atau telah <a href="%3$s">menentukan webhook lawas</a>, tetapi gagal untuk mengaktifkannya (lihat detail error di <a href="%4$s">log WooCommerce</a>). Buka <a href="%5$s">halaman plugin</a> dan aktifkan secara manual. <a href="%6$s">Informasi selengkapnya</a>','Please enter a valid email at checkout to use coupon code "%s".'=>'Masukkan email valid saat checkout untuk menggunakan kode kupon "%s".','Please enter a valid email to use coupon code "%s".'=>'Masukkan email valid untuk menggunakan kode kupon "%s".','To allow logging, make %s writable.'=>'Untuk mengizinkan logging, buat %s dapat ditulisi.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Pengambilan lokal: Siapkan lokasi pengambilan di <a href="%s">halaman pengaturan Pengambilan lokal</a>.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Pelajari metode pengiriman baru nan canggih yang memudahkan Anda menawarkan satu atau beberapa lokasi pengambilan kepada pelanggan di <a href="%s">halaman pengaturan Pengambilan lokal</a>.','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'Dengan mengumpulkan data penggunaan, kami dapat menyesuaikan pengalaman penyiapan toko Anda, menawarkan konten yang lebih relevan, dan mendukung WooCommerce menjadi lebih baik untuk semua orang.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'<a href="%1$s">Instal Pengelola Pembaruan WooCommerce.com</a> agar Anda terus mendapatkan pembaruan dan dukungan efisien yang termasuk dalam langganan WooCommerce.com. Anda juga dapat <a href="%2$s">mengunduh</a> dan menginstalnya secara manual.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'<a href="%1$s">Aktifkan Pengelola Pembaruan WooCommerce.com</a> agar Anda terus mendapatkan pembaruan dan dukungan efisien yang termasuk dalam langganan WooCommerce.com.',' Activate WooCommerce.com Update Manager to update.'=>' Aktifkan Pengelola Pembaruan WooCommerce.com untuk melakukan pembaruan.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' <a href="%1$s">Instal Pengelola Pembaruan WooCommerce.com</a> untuk melakukan pembaruan.','block keywordrich-text'=>'rich-text','block keywordtextarea'=>'area teks','block descriptionA text-area field for use in the product editor.'=>'Kolom area teks untuk digunakan di editor produk.','block titleProduct textarea block'=>'Blok area teks produk','block keywordsubsection'=>'subbagian','block descriptionThe product subsection description.'=>'Deskripsi subbagian produk.','block titleProduct subsection description'=>'Deskripsi subbagian produk','Invalid %s provided.'=>'%s yang dimasukkan tidak valid.','Internal server error'=>'Error server internal','Sorry, you cannot delete resources.'=>'Maaf, Anda tidak dapat menghapus sumber daya ini.','Sorry, you cannot create resources.'=>'Maaf, Anda tidak bisa membuat sumber daya.','Sorry, you cannot view resources.'=>'Maaf, Anda tidak dapat melihat sumber daya.','True to force the creation of a new receipt even if one already exists and has not expired yet.'=>'Benar untuk memaksa pembuatan tanda terima baru meski sudah ada tanda terima yang belum kedaluwarsa.','Number of days to be added to the current date to get the expiration date.'=>'Jumlah hari yang ditambahkan ke tanggal hari ini untuk menentukan tanggal kedaluwarsa.','Expiration date formatted as yyyy-mm-dd.'=>'Format tanggal kedaluwarsa adalah yyyy-mm-dd.','Expiration date of the receipt, formatted as yyyy-mm-dd.'=>'Format tanggal kedaluwarsa tanda terima adalah yyyy-mm-dd.','Public url of the receipt.'=>'URL publik tanda terima.','Unique identifier of the order.'=>'Identifikasi unik untuk pesanan tersebut.','Order not found'=>'Pesanan tidak ditemukan','Receipt not found'=>'Tanda terima tidak ditemukan','Account Type'=>'Jenis Akun','AID'=>'AID