aan untuk pesanan %d:','No differences found.'=>'Perbedaan tidak ditemukan.','An error occurred while computing a diff for order %1$d: %2$s'=>'Terjadi error saat menghitung perbedaan untuk pesanan %1$d: %2$s','Orders subject to cleanup: %d'=>'Pesanan yang dikenakan pembersihan: %d','Unsynced orders: %d'=>'Pesanan yang tidak disinkronkan: %d','Compatibility mode enabled?: %s'=>'Mode kompatibilitas diaktifkan?: %s','HPOS enabled?: %s'=>'HPOS diaktifkan?: %s','Select ratings'=>'Pilih peringkat','Select a rating'=>'Pilih peringkat','Minimal'=>'Minimal','A link to a product sold on a different website, e.g. brand collab.'=>'Tautan ke produk yang dijual di situs lain, misalnya, kolaborasi merek.','Affiliate product'=>'Produk Afiliasi','A set of products that go well together, e.g. camera kit.'=>'Kumpulan produk yang cocok digabungkan, misalnya, kit kamera.','A single physical or virtual product, e.g. a t-shirt or an eBook.'=>'Produk fisik atau virtual secara satuan, misalnya, t-shirt atau eBook.','Boost international sales and save on FX fees. Accept 60+ local payment methods including Apple Pay and Google Pay.'=>'Dongkrak penjualan internasional dan hemat biaya transaksi valas. Terima 60+ metode pembayaran lokal, termasuk Apple Pay dan Google Pay.','Airwallex Payments'=>'Pembayaran dengan Airwallex','Coupons for groups. Provides the option to have coupons that are restricted to group members or roles. Works with the free Groups plugin.'=>'Kupon untuk grup. Memberikan pilihan untuk menerapkan kupon terbatas bagi anggota atau peran dalam grup. Berfungsi baik dengan plugin Groups gratis.','Give away a free item to any customer with the coupon code.'=>'Berikan item gratis kepada pelanggan yang punya kode kupon.','Create "store credit" coupons for customers which are redeemable at checkout.'=>'Buat kupon "kredit toko" untuk pelanggan yang dapat ditukar saat checkout.','Create a unique URL that applies a discount and optionally adds one or more products to the customer\'s cart