h','Summarize this product in 1-2 short sentences. We’ll show it at the top of the page.'=>'Rangkum produk ini dalam 1-2 kalimat pendek. Kami akan menampilkannya di atas halaman.','Describe this product. What makes it unique? What are its most important features?'=>'Deskripsikan produk ini. Apa yang membuatnya unik? Apa manfaat paling penting yang dimilikinya?','Product types define available product details and attributes, such as downloadable files and variations. They’re also used for analytics and inventory management.'=>'Jenis produk menjelaskan detail dan atribut produk yang tersedia, seperti berkas yang dapat diunduh dan variasi. Jenis produk juga digunakan untuk analitik dan pengelolaan inventaris.','<b>Variable –</b> a product with variations, each of which may have a different SKU, price, stock option, etc. For example, a t-shirt available in different colors and/or sizes.'=>'<b>Variabel –</b> produk dengan variasi, masing-masing dapat memiliki SKU, harga, pilihan stok, dll. yang berbeda. Contohnya, sebuah kaus tersedia dalam beragam warna dan/atau ukuran.','<b>External or Affiliate –</b> one that you list and describe on your website but is sold elsewhere.'=>'<b>Eksternal atau Afiliasi –</b> produk yang dicantumkan dan dijelaskan di situs Anda tetapi dijual di tempat lain.','<b>Grouped –</b> a collection of related products that can be purchased individually and only consist of simple products. For example, a set of six drinking glasses.'=>'<b>Dikelompokkan –</b> kumpulan produk terkait yang dapat dibeli secara individu dan hanya terdiri dari produk sederhana. Misalnya, satu set enam gelas minum.','<b>Simple –</b> covers the vast majority of any products you may sell. Simple products are shipped and have no options. For example, a book.'=>'<b>Sederhana –</b> mencakup berbagai produk yang dapat Anda jual. Produk sederhana telah dikemas dan tidak memiliki pilihan. Contohnya, sebuah buku.','Sofia District'=>'Sofia District','block descriptionDisplay product