k. (Usang)','%1$s could not be served using the Force Download method. A redirect will be used instead.'=>'%1$s tidak dapat dilayani menggunakan metode Unduh Paksa. Sebagai gantinya, metode pengalihan akan digunakan.','%1$s could not be served using the X-Accel-Redirect/X-Sendfile method. A Force Download will be used instead.'=>'%1$s tidak dapat dilayani menggunakan metode the X-Accel-Redirect/X-Sendfile. Sebagai gantinya, metode Unduh Paksa akan digunakan.','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Jika metode "Unduh Paksa" atau "X-Accel-Redirect/X-Sendfile" sudah dipilih tetapi tidak berfungsi, sistem akan menggunakan metode "Pengalihan" sebagai pilihan terakhir. <a href="%1$s">Lihat panduan ini</a> untuk detail selengkapnya.','Allow using redirect mode (insecure) as a last resort'=>'Izinkan penggunaan metode pengalihan (tidak aman) sebagai pilihan terakhir','Set your store location and where you\'ll ship to.'=>'Atur lokasi toko dan mana saja daerah tujuan pengiriman yang dilayani.','Choose payment providers and enable payment methods at checkout.'=>'Pilih penyedia pembayaran dan aktifkan metode pembayaran yang digunakan saat checkout.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Tinggal selangkah lagi, lalu Anda siap menerima pembayaran. Periksa detail bisnis Anda untuk bisa mulai mengelola transaksi dengan WooPayments.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Mulai dengan menambahkan produk pertama ke toko Anda. Produk bisa ditambahkan manual, lewat CSV, atau dengan mengimpornya dari layanan lain.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Alama