s'=>'Monagas','Miranda'=>'Miranda','Mérida'=>'Mérida','Lara'=>'Lara','Guárico'=>'Guárico','Falcón'=>'Falcón','Cojedes'=>'Cojedes','Carabobo'=>'Carabobo','Bolívar'=>'Bolívar','Barinas'=>'Barinas','Aragua'=>'Aragua','Apure'=>'Apure','Anzoátegui'=>'Anzoátegui','Capital'=>'Ibu Kota','Filling in progress (%d)'=>'Pengisian sedang berjalan (%d)','Product attributes lookup table data is regenerating'=>'Data tabel pencarian atribut produk sedang dibuat ulang','This tool will regenerate the product attributes lookup table data from existing product(s) data. This process may take a while.'=>'Alat ini akan membuat ulang data tabel pencarian atribut produk dari data produk yang sudah ada. Proses ini dapat memerlukan waktu beberapa saat.','Regenerate the product attributes lookup table'=>'Buat ulang tabel pencarian atribut produk','Paystack helps African merchants accept one-time and recurring payments online with a modern, safe, and secure payment gateway.'=>'Paystack membantu pedagang dari Afrika untuk menerima pembayaran online satu kali atau berulang dengan gateway pembayaran yang modern, aman, dan nyaman.','Paystack'=>'Paystack','%s connected successfully'=>'%s berhasil dihubungkan','MailPoet'=>'MailPoet','How easy was it to add a product attribute?'=>'Seberapa mudah Anda menambahkan atribut produk?','How easy was it to add product category?'=>'Seberapa mudah Anda menambahkan kategori produk?','How easy was it to use search?'=>'Seberapa mudah Anda menggunakan pencarian?','Nice one; you\'ve created a WooCommerce store! Now it\'s time to add your first product and get ready to start selling.%s'=>'Nice one; Anda sudah membuat toko WooCommerce! Sekarang saatnya menambahkan produk pertama Anda dan bersiap untuk melakukan penjualan.%s','Hi there,'=>'Halo!','%s (optional)'=>'%s (opsional)','Enable PayU’s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'Aktifkan plugin eksklus