eing shipped to.'=>'Kode ISO negara tujuan pengiriman.','Zip or Postcode of the address being shipped to.'=>'Kode pos alamat tujuan pengiriman.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'Kode ISO atau nama negara bagian, provinsi, atau kecamatan dari alamat tujuan pengiriman.','City of the address being shipped to.'=>'Kota alamat tujuan pengiriman.','Second line of the address being shipped to.'=>'Baris kedua alamat tujuan pengiriman.','First line of the address being shipped to.'=>'Baris pertama alamat tujuan pengiriman.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Membatasi set hasil pada produk berdasarkan harga tertinggi, disediakan menggunakan satuan mata uang terkecil.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Membatasi set hasil pada produk berdasarkan harga terendah, disediakan menggunakan satuan mata uang terkecil.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Jumlah maksimum item yang dikembalikan pada set hasil. Jumlah item akan menjadi tak terbatas apabila dibiarkan kosong.','Invalid category ID.'=>'ID kategori tidak valid.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Pembuatan tabel WooCommerce %1$s gagal. Apakah pengguna %2$s telah MEMBUAT hak istimewa pada database %3$s?','Verifying database... One or more tables are still missing: '=>'Memverifikasi database... Satu atau lebih tabel masih tidak ada:','Database verified successfully.'=>'Database berhasil diverifikasi.','You need WooCommerce 4.2 or newer to run this tool.'=>'Anda membutuhkan WooCommerce versi 4.2 atau versi yang lebih baru untuk menjalankan alat ini.','The active version of WooCommerce does not support template cache clearing.'=>'Versi aktif WooCommerce tidak mendukung penghapusan cache template