ique identifier for the item within the cart.'=>'Pengenal unik untuk item dalam keranjang.','Unable to retrieve cart.'=>'Tidak dapat mengambil keranjang.','Attribute does not exist.'=>'Atribut tidak ada.','Unique identifier for the attribute.'=>'Pengenal unik untuk atribut.','No matching variation found.'=>'Tidak ditemukan variasi yang cocok.','Missing variation data for variable product.'=>'Data variasi untuk produk variabel tidak ada.','Invalid value posted for %1$s. Allowed values: %2$s'=>'Nilai tidak valid diposkan untuk %1$s. Nilai yang diizinkan: %2$s','This product cannot be added to the cart.'=>'Produk ini tidak dapat ditambahkan ke keranjang.','Total post count.'=>'Total jumlah pos.','Xaisomboun'=>'Xaisomboun','Xiangkhouang'=>'Xiangkhouang','Sekong'=>'Sekong','Sainyabuli'=>'Sainyabuli','Vientiane'=>'Vientiane','Vientiane Province'=>'Provinsi Vientiane','Savannakhet'=>'Savannakhet','Salavan'=>'Salavan','Phongsaly'=>'Phongsaly','Oudomxay'=>'Oudomxay','Luang Prabang'=>'Luang Prabang','Luang Namtha'=>'Luang Namtha','Khammouane'=>'Khammouane','Houaphanh'=>'Houaphanh','Champasak'=>'Champasak','Bolikhamsai'=>'Bolikhamsai','Bokeo'=>'Bokeo','Attapeu'=>'Attapeu','checkout-validationBilling %s'=>'Penagihan %s','checkout-validationShipping %s'=>'Pengiriman %s','Thank you for your payment. Your transaction has been completed, and a receipt for your purchase has been emailed to you. Log into your PayPal account to view transaction details.'=>'Terima kasih atas pembayaran Anda. Transaksi sudah selesai, dan tanda terima untuk pembelian Anda telah dikirim melalui email. Masuk ke akun PayPal untuk melihat detail transaksi.','You cannot add a new payment method so soon after the previous one. Please wait for %d second.'=>'Anda tidak dapat menambahkan metode pembayaran yang baru terlalu cepat setelah menambahkan yang sebelumnya. Harap tunggu selama %d detik.' . "\0" . 'Anda tidak dapat menambahkan metode pembayaran yang baru terlalu cepat setelah menambahkan yang sebelumnya.