uced rate'=>'Tarif diskon','Congratulations on the sale.'=>'Selamat Anda telah menjual produk Anda.','Thanks for using {site_url}!'=>'Terima kasih telah menggunakan {site_url}!','Text to appear below the main email content.'=>'Teks yang akan ditampilkan di bawah konten email utama.','Additional content'=>'Konten tambahan','Town / Village'=>'Kota/Desa','Postal code'=>'Kode pos','Invalid field'=>'Kolom tidak valid','Tax class slug already exists'=>'Slug kelas pajak sudah ada','Tax class requires a valid name'=>'Kelas pajak mengharuskan nama valid','Or you can download a pre-built version of the plugin from the <a href="%1$s">WordPress.org repository</a> or by visiting <a href="%2$s">the releases page in the GitHub repository</a>.'=>'Atau Anda dapat mengunduh versi pra-pasang plugin dari <a href="%1$s">repositori WordPress.org</a> atau dengan mengunjungi <a href="%2$s">halaman rilis di repositori GitHub</a>.','Order not editable'=>'Urutan tidak dapat disunting','You do not have permission to install plugins.'=>'Anda tidak punya izin untuk menginstal plugin.','Learn how to upgrade'=>'Pelajari cara upgrade','The sale will start at 00:00:00 of "From" date and end at 23:59:59 of "To" date.'=>'Obral akan dimulai pukul 00:00:00 pada tanggal "Dari” dan berakhir pukul 23:59:59 pada tanggal "Sampai".','Order fully refunded.'=>'Dana pesanan telah dikembalikan sepenuhnya.','Selecting no country / region to sell to prevents from completing the checkout. Continue anyway?'=>'Tidak memilih negara/wilayah tujuan penjualan menyebabkan checkout tidak dapat diselesaikan. Tetap lanjutkan?','Please enter a valid Eircode.'=>'Masukkan Eircode yang valid.','There was a failure fetching this action'=>'Terjadi kegagalan saat mengambil tindakan ini','&larr; Back to "%s" attributes'=>'← Kembali ke atribut "%s"','Note: WP CRON has been disabled on your install which may prevent this update from completing.'=>'Catatan: WP CRON dinonaktifkan di penginstalan Anda, yang dapat membuat pembaruan ini tid