patibilitas tema dengan versi WooCommerce saat ini.','<strong>Your theme (%s) contains outdated copies of some WooCommerce template files.</strong> These files may need updating to ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>Tema Anda (%s) berisi salinan beberapa file template WooCommerce yang telah kedaluwarsa.</strong> File ini mungkin perlu diperbarui untuk memastikannya kompatibel dengan versi WooCommerce saat ini. Saran untuk memperbaiki ini:','Export all categories'=>'Ekspor semua kategori','Which product category should be exported?'=>'Kategori produk mana yang perlu diekspor?','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'Ini adalah ID lampiran atau URL gambar, yang digunakan untuk gambar placeholder di katalog produk. Produk tanpa gambar akan menggunakan ini.','Enter attachment ID or URL to an image'=>'Masukkan URL atau ID lampiran ke gambar','Placeholder image'=>'Gambar placeholder','The "%s" payment method is currently disabled'=>'Metode pembayaran "%s" saat ini tidak aktif','The "%s" payment method is currently enabled'=>'Metode pembayaran "%s" saat ini aktif','Set up the "%s" payment method'=>'Siapkan metode pembayaran "%s"','Manage the "%s" payment method'=>'Kelola metode pembayaran "%s"','Move down'=>'Geser bawah','Move the "%s" payment method down'=>'Geser metode pembayaran "%s" ke bawah','Move up'=>'Geser atas','Move the "%s" payment method up'=>'Geser metode pembayaran "%s” ke atas','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'Saat menangani %s, apakah akses ke file yang dapat diunduh dicabut dan unduhan log dihapus?','When handling an %s, should personal data within orders be retained or removed?'=>'Saat menangani %s, apakah data pribadi dalam pesanan harus disimpan atau dihapus?','Enter a number to set stock quantity at the variation level. Use a 