or these Zones or offer Free Shipping.'=>'Kami telah membuat dua Zona Pengiriman - untuk %s dan untuk negara-negara lainnya di dunia. Di bawah ini, Anda dapat menetapkan biaya pengiriman Tarif Tetap untuk dua Zona ini atau menawarkan Pengiriman Gratis.','Yards'=>'Yard','Inches'=>'Inci','Millimeters'=>'Milimeter','Centimeters'=>'Sentimeter','Meters'=>'Meter','Ounces'=>'Ons','Pounds'=>'Pon','Grams'=>'Gram','Kilograms'=>'Kilogram','Item moved down'=>'Item digeser turun','Item moved up'=>'Item digeser naik','You may need to manually restore the item\'s stock.'=>'Anda mungkin perlu mengisi kembali stok item secara manual.','Are you sure you want to remove the selected items?'=>'Anda yakin ingin menghapus item terpilih?','Alto Paraguay'=>'Alto Paraguay','Presidente Hayes'=>'Presidente Hayes','Amambay'=>'Amambay','Central'=>'Central','Cordillera'=>'Cordillera','San Pedro'=>'San Pedro','Sud Sardegna'=>'Sardinia Selatan','Apartment, suite, unit, etc.'=>'Apartemen, suit, unit, dll.','%d API key permanently revoked.'=>'%d Kunci API dicabut permanen.' . "\0" . '%d Kunci API dicabut permanen.','Cannot set attributes due to invalid parent product.'=>'Tidak dapat menetapkan atribut karena produk induk tidak valid.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Tindakan ini tidak dapat diurungkan. Anda yakin ingin membuang data pribadi dari pesanan yang dipilih?','shipping packagesShipping %d'=>'Pengiriman %d','Payer PayPal address'=>'Alamat PayPal pembayar','Payer last name'=>'Nama belakang pembayar','Payer first name'=>'Nama depan pembayar','Shipping Address'=>'Alamat Pengiriman','Billing Address'=>'Alamat Penagihan','Shipping Address 1'=>'Alamat Pengiriman 1','Billing Address 1'=>'Alamat Penagihan 1','MySQL version string.'=>'String versi MySQL.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'CSV Anda harus mencantumkan kolom dalam urutan tertentu. %1$sKlik di sini untuk mengunduh contoh%2$s.','This will be how your name will be displayed in the account section and in reviews'=>'Nama ini yang akan ditampilkan di bagian akun dan ulasan','If you have a coupon code, please apply it below.'=>'Jika Anda memiliki kode kupon, masukkan di bawah ini.','United States (US) dollar'=>'Dolar Amerika Serikat (US)','eCheck ending in %1$s'=>'eCheck berakhir pada %1$s','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal mengizinkan kami untuk mengirim ke satu alamat. Jika Anda menggunakan Paypal dengan label pengiriman, Anda dapat memilih untuk mengirim ke alamat pengiriman daripada ke penagihan. Menonaktifkan pilihan ini dapat mencegah perlindungan Penjual PayPal dari menerapkan kode kupon.','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'Standar PayPal mengalihkan pelanggan ke PayPal untuk memasukkan informasi pembayaran.','Other locations'=>'Lokasi lain','%1$s &ndash; %2$s'=>'%1$s – %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'Metode "%1$s" apa pun','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Terima pembayaran secara langsung melalui cek. Gateway offline ini juga dapat berguna untuk mencoba pembelian.','Account details:'=>'Rincian akun:','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Terima pembayaran secara langsung melalui BACS. Lebih dikenal sebagai transfer bank/wire.','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'tentang,sebuah,adalah,dengan,di,oleh,akan,untuk,dari,bagaimana,dalam,ini,itu,situ,darimana,sini,apa,kapan,ketika,mana,siapa,www','Optionally add some text for the terms checkbox that customers must accept.'=>'Menambahkan beberapa teks secara opsional untuk kotak centang persyaratan yang harus diterima pelanggan.','%s page'=>'%s halaman','No page set'=>'Belum ada halaman yang ditetapkan','Highlight required fields with an asterisk'=>'Tandai bidang yang wajib diisi dengan tanda bintang','I have read and agree to the website %s'=>'Saya sudah membaca dan setuju dengan situs %s ','Required'=>'Wajib','%s field'=>'%s bidang','These options let you change the appearance of the WooCommerce checkout.'=>'Pilihan ini memungkinkan Anda untuk mengubah tampilan checkout WooCommerce.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Silakan lihat <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">Kebijakan Privasi PayPal</a> untuk lebih jelasnya.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Kami menerima pembayaran melalui PayPal. Saat memproses pembayaran, beberapa data Anda akan diteruskan ke PayPal, termasuk informasi yang diperlukan untuk memproses atau mendukung pembayaran, seperti total pembelian dan informasi penagihan.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'Di subbagian ini Anda harus mencantumkan prosesor pembayaran pihak ketiga mana yang Anda gunakan untuk melakukan pembayaran di toko Anda karena ini dapat menangani data pelanggan. Kami telah menyertakan PayPal sebagai contoh, tetapi Anda harus menghapus ini jika Anda tidak menggunakan PayPal.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Kami berbagi informasi dengan pihak ketiga yang membantu kami menyediakan pesanan dan layanan toko kepada Anda; sebagai contoh --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'Di bagian ini Anda harus mendaftarkan dengan siapa Anda berbagi data, dan untuk tujuan apa. Ini dapat mencakup, tetapi mungkin tidak terbatas pada, analitik, pemasaran, gateway pembayaran, penyedia pengiriman, dan penyematan pihak ketiga.','What we share with others'=>'Apa yang kami bagikan dengan orang lain','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Anggota tim kami memiliki akses ke informasi ini untuk membantu memenuhi pesanan, memproses pengembalian uang, dan membantu Anda.','Customer information like your name, email address, and billing and shipping information.'=>'Informasi pelanggan seperti nama Anda, alamat e-mail, dan informasi penagihan dan pengiriman.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Informasi pesanan seperti apa yang dibeli, kapan dibeli dan ke mana harus dikirim, dan','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Anggota tim kami memiliki akses ke informasi yang Anda berikan kepada kami. Misalnya, Administrator dan Manajer Toko dapat mengakses:','Who on our team has access'=>'Siapa di tim kami yang memiliki akses','We will also store comments or reviews, if you choose to leave them.'=>'Kami juga akan menyimpan komentar atau ulasan, jika Anda memilih untuk meninggalkannya.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Kami umumnya menyimpan informasi tentang Anda selama kami membutuhkan informasi tersebut untuk tujuan yang kami kumpulkan dan gunakan, dan kami tidak diharuskan secara hukum untuk terus menyimpannya. Misalnya, kami akan menyimpan informasi pesanan selama XXX tahun untuk tujuan pajak dan akuntansi. Ini termasuk nama Anda, alamat e-mail dan alamat penagihan dan pengiriman.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Jika Anda membuat akun, kami akan menyimpan nama, alamat, e-mail, dan nomor telepon Anda, yang akan digunakan untuk mengisi checkout untuk pesanan selanjutnya.','Send you marketing messages, if you choose to receive them'=>'Kirim pesan pemasaran kepada Anda, jika Anda memilih untuk menerimanya','Improve our store offerings'=>'Tingkatkan penawaran toko kami','Comply with any legal obligations we have, such as calculating taxes'=>'Patuhi semua kewajiban hukum yang kita miliki, seperti menghitung pajak','Set up your account for our store'=>'Siapkan akun Anda untuk toko kami','Process payments and prevent fraud'=>'Proses pembayaran dan cegah penipuan','Respond to your requests, including refunds and complaints'=>'Tanggapi permintaan Anda, termasuk pengembalian uang dan keluhan','Send you information about your account and order'=>'Kirimi Anda informasi tentang akun dan pesanan Anda','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Ketika Anda membeli dari kami, kami akan meminta Anda untuk memberikan informasi termasuk nama Anda, alamat penagihan, alamat pengiriman, alamat e-mail, nomor telepon, detail pembayaran / kartu kredit dan informasi akun opsional seperti nama pengguna dan kata sandi. Kami akan menggunakan informasi ini untuk tujuan, seperti untuk:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Catatan: Anda mungkin ingin merinci lebih lanjut kebijakan cookie Anda, dan tautan ke bagian tersebut dari sini.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Kami juga akan menggunakan cookie untuk melacak konten keranjang saat Anda menjelajahi situs kami.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Alamat pengiriman: kami akan meminta Anda untuk memasukkan ini sehingga kami dapat, misalnya, memperkirakan pengiriman sebelum Anda melakukan pemesanan, dan mengirimkan pesanan kepada Anda!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Lokasi, alamat IP, dan jenis browser: kami akan menggunakan ini untuk tujuan seperti memperkirakan pajak dan pengiriman','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Produk yang telah Anda lihat: akan kami gunakan, misalnya, untuk menampilkan produk yang baru saja Anda lihat','While you visit our site, we’ll track:'=>'Saat Anda mengunjungi situs kami, kami akan melacak:','What we collect and store'=>'Apa yang kami kumpulkan dan simpan','We collect information about you during the checkout process on our store.'=>'Kami mengumpulkan informasi tentang Anda selama proses checkout di toko kami.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Contoh bahasa ini mencakup dasar-dasar seputar data pribadi apa yang mungkin dikumpulkan, disimpan, dan dibagikan, serta siapa yang mungkin memiliki akses ke data tersebut. Tergantung pada pengaturan apa yang diaktifkan dan plugin tambahan apa yang digunakan, informasi spesifik yang dibagikan oleh toko Anda akan bervariasi. Kami menyarankan berkonsultasi dengan pengacara ketika memutuskan informasi apa yang akan diungkapkan pada kebijakan privasi Anda.','Token'=>'Token','Payment Tokens'=>'Token Pembayaran','Access granted'=>'Akses diberikan','Download count'=>'Jumlah unduhan','User email'=>'Email pengguna','Browser User Agent'=>'Agen Pengguna Perambah','Items Purchased'=>'Item yang Dibeli','Order Number'=>'Nomor Pesanan','Download ID'=>'ID Unduhan','Access to Purchased Downloads'=>'Akses ke Unduhan yang Dibeli','Purchased Downloads'=>'Unduhan yang Dibeli','Customer Data'=>'Data Pelanggan','Removed payment token "%d"'=>'Token pembayaran yang dihapus "%d"','Personal data removed.'=>'Data pribadi dihapus.','Customer download permissions have been retained.'=>'Izin unduhan pelanggan telah dipertahankan.','Removed access to downloadable files.'=>'Akses dihapus ke file yang dapat diunduh.','Personal data within order %s has been retained.'=>'Data pribadi dalam pesanan %s telah dipertahankan.','Removed personal data from order %s.'=>'Data pribadi dihapus dari pesanan %s.','Removed customer "%s"'=>'Pelanggan  "%s" telah dihapus','Shipping State'=>'Status Pengiriman','Shipping Postal/Zip Code'=>'Kode Zip/Pos Pengiriman','Shipping City'=>'Kota Pengiriman','Shipping Company'=>'Perusahaan Pengiriman','Shipping Last Name'=>'Nama Belakang Pengiriman','Shipping First Name'=>'Nama Depan Pengiriman','Phone Number'=>'Nomor Telepon','Billing State'=>'Status Penagihan','Billing Postal/Zip Code'=>'Kode Zip/Pos Penagihan','Billing City'=>'Kota Penagihan','Billing Company'=>'Perusahaan Penagihan',