'=>'Izin unduhan yang digunakan','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Batasi hasil yang ditetapkan untuk produk dengan atribut tertentu. Gunakan slug nama/atribut taksonomi.','If the payment was refunded via the API.'=>'Jika pembayaran dikembalikan melalui API.','Order total formatted for locale'=>'Total pesanan diformat untuk lokal','Name of the customer for the order'=>'Nama pelanggan untuk pesanan','URL to edit the order'=>'URL untuk menyunting pesanan','Blog id of the record on the multisite.'=>'ID blog catatan pada multisitus.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Toko Anda sepertinya tidak menggunakan koneksi yang aman. Kami sangat menyarankan menyajikan keseluruhan situs web Anda melalui koneksi HTTPS untuk membantu menjaga keamanan data pelanggan. <a href="%s">Pelajari selengkapnya di sini.</a>','WooCommerce pages'=>'Halaman WooCommerce','WooCommerce database version'=>'Versi database WooCommerce','Displays whether or not WordPress is using an external object cache.'=>'Menampilkan apakah WordPress menggunakan eksternal tembolok objek atau tidak.','External object cache'=>'Eksternal tembolok objek.','WordPress cron'=>'Cron WordPress','WordPress debug mode'=>'Mode debug WordPress','WordPress memory limit'=>'Batas memori WordPress','WordPress multisite'=>'Multisitus WordPress','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Versi terbaru WordPress sudah tersedia (%2$s)','WordPress version'=>'Versi WordPress','WooCommerce version'=>'Versi WooCommerce','Settings tab labelPayments'=>'Pembayaran','Enable coupons'=>'Aktifkan kupon','Rates will be configurable and taxes will be calculated during checkout.'=>'Tarif akan dapat dikonfigurasi dan pajak akan dihitung saat melakukan checkout.','Enable tax rates and calculations'=>'Aktifkan tarif pajak dan penghitungan','Manage'=>'Kelola','Account endpoints'=>'Titik akhir akun','Secure checkout'=>'Amankan checkout','Legacy API'=>'API Lawas','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Simpan pesanan yang sudah selesai untuk jangka waktu tertentu sebelum menganonimkan data pribadi di dalamnya.','Retain completed orders'=>'Simpan pesanan yang sudah selesai','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Pesanan yang dibatalkan belum dibayar dan mungkin telah dibatalkan oleh pemilik toko atau pelanggan. Pesanan ini akan dibuang ke tempat sampah setelah durasi yang ditentukan.','Retain cancelled orders'=>'Simpan pesanan yang dibatalkan','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Pesanan yang gagal adalah pesan yang tidak dibayar dan mungkin telah ditinggalkan oleh pelanggan. Pesanan ini akan dibuang ke tempat sampah setelah durasi yang ditentukan.','Retain failed orders'=>'Pertahankan pesanan yang gagal','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Pesanan tertunda adalah pesan yang tidak dibayar dan mungkin telah ditinggalkan oleh pelanggan. Pesanan ini akan dibuang ke tempat sampah setelah durasi yang ditentukan.','Retain pending orders '=>'Simpan pesanan yang tertunda','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Akun non-aktif adalah akun yang belum login, atau melakukan pemesanan, selama durasi tertentu. Akun ini akan dihapus. Setiap pesanan akan diubah menjadi pesanan tamu.','Retain inactive accounts '=>'Pertahankan akun yang tidak aktif','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Pilih berapa lama untuk menyimpan data pribadi ketika tidak lagi diperlukan untuk diproses. Biarkan pilihan berikut kosong untuk menyimpan data ini tanpa batas.','Personal data retention'=>'Retensi data pribadi','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Data pribadi Anda akan digunakan untuk memproses pesanan Anda, menunjang pengalaman Anda di seluruh situs web ini, dan untuk tujuan lain yang dijelaskan dalam %s kami.','Optionally add some text about your store privacy policy to show during checkout.'=>'Menambahkan beberapa teks tentang kebijakan privasi toko Anda untuk ditunjukkan saat melakukan checkout.','Checkout privacy policy'=>'Kebijakan privasi checkout','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Data pribadi Anda akan digunakan untuk menunjang pengalaman Anda di seluruh situs web ini, untuk mengelola akses ke akun Anda, dan untuk tujuan lain yang dijelaskan dalam %s kami.','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Menambahkan beberapa teks tentang kebijakan privasi toko Anda untuk ditunjukkan pada formulir registrasi akun.','Registration privacy policy'=>'Kebijakan privasi registrasi','privacy page'=>'halaman privasi','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Bagian ini mengendalikan tampilan kebijakan privasi situs web Anda. Pemberitahuan privasi di bawah ini tidak akan muncul kecuali jika %s diatur.','Privacy policy'=>'kebijakan privasi','Removed personal data from %s order.'=>'Data pribadi dihapus dari %s pesanan.' . "\0" . 'Data pribadi dihapus dari %s pesanan.','Account erasure requests'=>'Permintaan penghapusan akun','Accounts &amp; Privacy'=>'Akun & Privasi','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Daftar email penagihan yang diizinkan untuk pencocokan saat pesanan dilakukan. Pisahkan alamat email dengan koma. Anda juga dapat menggunakan tanda bintang (*) untuk mencocokkan bagian-bagian dari email. Misalnya "*@gmail.com" akan cocok dengan semua alamat gmail.','Allowed emails'=>'Email yang diizinkan','Filter by registered customer'=>'Saring menurut pelanggan yang terdaftar','Remove personal data'=>'Hapus data pribadi','Use previous column mapping preferences?'=>'Gunakan preferensi pemetaan kolom yang sebelumnya?','View &amp; Customize'=>'Lihat & Sesuaikan','Review Settings'=>'Pengaturan Ulasan','Visit Dashboard'=>'Kunjungi Dasbor','You can also:'=>'Anda juga dapat:','You\'re ready to add products to your store.'=>'Anda sekarang siap untuk menambahkan produk ke toko Anda.','Create some products'=>'Buat beberapa produk','Continue with WooCommerce Services'=>'Lanjutkan dengan Layanan WooCommerce','Connect your store to activate WooCommerce Services'=>'Hubungkan toko Anda untuk mengaktifkan Layanan WooCommerce','Thanks for using Jetpack! Your store is almost ready: to activate services like %s, just connect your store.'=>'Terima kasih telah menggunakan Jetpack! Toko Anda hampir siap: untuk mengaktifkan layanan seperti %s, cukup hubungkan toko Anda.','Mailchimp for WooCommerce'=>'MailChimp untuk WooCommerce','Mailchimp icon'=>'Ikon MailChimp','Join the 16 million customers who use Mailchimp. Sync list and store data to send automated emails, and targeted campaigns.'=>'Bergabung dengan 16 juta pelanggan yang menggunakan Mailchimp. Sinkronkan daftar dan data toko Anda untuk mengirim email otomatis, dan kampanye yang ditargetkan.','Mailchimp'=>'Mailchimp'