vider.'=>'%s gagal. Hubungi penyedia hosting Anda.','Forcing downloads will keep URLs hidden, but some servers may serve large files unreliably. If supported, %1$s / %2$s can be used to serve downloads instead (server requires %3$s).'=>'Pengunduhan paksa akan menyembunyikan URL, tetapi beberapa server mungkin menyajikan file berukuran besar secara tidak stabil. Jika didukung, %1$s / %2$s dapat digunakan untuk menyajikan unduhan sebagai gantinya (server memerlukan %3$s).','The postal code, if any, in which your business is located.'=>'Kode pos, jika ada, lokasi bisnis Anda.','The country and state or province, if any, in which your business is located.'=>'Negara dan negara bagian atau provinsi, jika ada, lokasi bisnis Anda.','Country / State'=>'Negara/Negara Bagian','The city in which your business is located.'=>'Kota lokasi bisnis Anda.','An additional, optional address line for your business location.'=>'Baris alamat tambahan opsional untuk lokasi bisnis Anda.','The street address for your business location.'=>'Alamat jalan lokasi bisnis Anda.','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Ini adalah lokasi bisnis Anda. Tarif pajak dan ongkos kirim akan menggunakan alamat ini.','Store Address'=>'Alamat Toko','Update now'=>'Perbarui sekarang','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'Plugin aktif berikut belum menyatakan kompatibilitas dengan WooCommerce %s dan harus diperbarui serta diperiksa lebih lanjut sebelum Anda melanjutkan proses:','Tested up to WooCommerce version'=>'Dites dengan versi WooCommerce','Plugin'=>'Plugin','unknown'=>'tidak diketahui','<strong>Heads up!</strong> The versions of the following plugins you\'re running haven\'t been tested with WooCommerce %s. Please update them or confirm compatibility before updating WooCommerce, or you may experience issues:'=>'<strong>Harap diketahui!</strong> Versi plugin yang Anda jalankan berikut ini belum dites dengan WooCommerce %s. Perbarui plugin atau pastikan kompatibilitasnya sebelum memperbarui WooCommerce, jika tidak, Anda mungkin mengalami masalah:','Refund #%1$s - %2$s by %3$s'=>'Pengembalian dana #%1$s - %2$s oleh %3$s','Add shipping'=>'Tambahkan cara pengiriman','The stock has not been updated because the value has changed since editing. Product %1$d has %2$d units in stock.'=>'Stok belum diperbarui karena nilai telah berubah sejak penyuntingan. Produk %1$d tersedia sebanyak %2$d unit.','Order details manually sent to customer.'=>'Detail pesanan dikirim secara manual kepada pelanggan.','Choose an action...'=>'Pilih tindakan...','Send order details to customer'=>'Kirim detail pesanan kepada pelanggan','Position'=>'Posisi','Upload a new file'=>'Unggah file baru','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'File kosong atau menggunakan pengkodean selain UTF-8, coba lagi dengan file baru.','Lifetime Subscription'=>'Langganan Seumur Hidup','Sort by:'=>'Urutkan berdasarkan:','Below is a list of extensions available on your WooCommerce.com account. To receive extension updates please make sure the extension is installed, and its subscription activated and connected to your WooCommerce.com account. Extensions can be activated from the <a href="%s">Plugins</a> screen.'=>'Berikut adalah daftar ekstensi yang tersedia di akun WooCommerce.com Anda. Untuk mendapatkan pembaruan ekstensi, pastikan ekstensi telah diinstal, dan langganannya diaktifkan serta terhubung ke akun WooCommerce.com Anda. Ekstensi dapat diaktifkan dari layar <a href="%s">Plugin</a>.','Expired'=>'Sudah Berakhir','Expiring Soon'=>'Segera Berakhir','Update Available'=>'Pembaruan Tersedia','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'Jika Anda suka %1$s, beri kami peringkat %2$s. Terima kasih banyak sebelumnya!','Transfer existing products to your new store — just import a CSV file.'=>'Transfer produk yang ada ke toko baru Anda, cukup dengan mengimpor file CSV.','Import products'=>'Impor produk','Have an existing store?'=>'Sudah punya toko?','Create a product'=>'Buat produk','Yes please!'=>'Ya!','We\'re here for you — get tips, product updates, and inspiration straight to your mailbox.'=>'Kami siap membantu Anda. Dapatkan tips, pembaruan produk, dan inspirasi, langsung di kotak surat Anda.','You\'re ready to start selling!'=>'Anda siap mulai menjual!','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Situs Anda mungkin menggunakan jaringan pribadi. Jetpack hanya bisa terhubung ke situs publik. Pastikan situs Anda dapat dilihat di internet, lalu coba hubungkan lagi 🙏.','Sorry! We couldn\'t contact Jetpack just now 😭. Please make sure that your site is visible over the internet, and that it accepts incoming and outgoing requests via curl. You can also try to connect to Jetpack again, and if you run into any more issues, please contact support.'=>'Maaf! Saat ini kami tidak bisa menghubungkan Jetpack 😭. Pastikan situs Anda dapat dilihat di internet, dan menerima permintaan masuk dan keluar melalui curl. Anda juga bisa mencoba menghubungkan ke Jetpack lagi, dan jika mengalami masalah lainnya, silakan hubungi dukungan.','Sorry! We tried, but we couldn\'t install Jetpack for you 😭. Please go to the Plugins tab to install it, and finish setting up your store.'=>'Maaf! Kami sudah mencoba, tetapi tidak dapat menginstal Jetpack untuk Anda 😭. Buka tab Plugin untuk menginstalnya, dan selesaikan penyiapan toko Anda.','Sorry! We tried, but we couldn\'t connect Jetpack just now 😭. Please go to the Plugins tab to connect Jetpack, so that you can finish setting up your store.'=>'Maaf! Kami sudah mencoba, tetapi saat ini kami tidak dapat menghubungkan Jetpack 😭. Buka tab Plugin untuk menghubungkan Jetpack agar Anda dapat menyelesaikan penyiapan toko.','Share new items on social media the moment they\'re live in your store.'=>'Bagikan item baru di media sosial begitu item tersebut aktif di toko Anda.','Product promotion'=>'Promosi produk','Get an alert if your store is down for even a few minutes.'=>'Dapatkan pemberitahuan jika toko Anda tidak aktif walaupun hanya beberapa menit.','Store monitoring'=>'Pemantauan toko','Get insights on how your store is doing, including total sales, top products, and more.'=>'Dapatkan wawasan mengenai performa toko Anda, yang meliputi penjualan total, produk teratas, dan sebagainya.','Store stats'=>'Statistik toko','Protect your store from unauthorized access.'=>'Lindungi toko Anda dari akses tanpa izin.','Better security'=>'Keamanan lebih kuat','Bonus reasons you\'ll love Jetpack'=>'Alasan lain mengapa Anda akan menyukai Jetpack','By connecting your site you agree to our fascinating <a href="%1$s" target="_blank">Terms of Service</a> and to <a href="%2$s" target="_blank">share details</a> with WordPress.com'=>'Dengan menghubungkan situs, berarti Anda menyetujui <a href="%1$s" target="_blank">Ketentuan Layanan</a> kami yang menarik dan setuju untuk <a href="%2$s" target="_blank">membagikan detail</a> kepada WordPress.com','Finish setting up your store'=>'Selesaikan penyiapan toko Anda','Connect your store to Jetpack to enable extra features'=>'Hubungkan toko Anda ke Jetpack untuk mengaktifkan fitur ekstra','Connect your store to Jetpack'=>'Hubungkan toko Anda ke Jetpack','Sorry, we couldn\'t connect your store to Jetpack'=>'Maaf, kami tidak dapat menghubungkan toko Anda ke Jetpack','automated taxes'=>'pajak otomatis','payment setup, automated taxes and discounted shipping labels'=>'penyiapan pembayaran, pajak otomatis, dan label diskon pengiriman','Your store is almost ready! To activate services like %s, just connect with Jetpack.'=>'Toko Anda hampir siap! Untuk mengaktifkan layanan seperti %s, cukup hubungkan situs ke Jetpack.','Automated Taxes'=>'Pajak Otomatis','Storefront Theme'=>'Tema Storefront','Collect payments from customers offline.'=>'Terima pembayaran dari pelanggan secara offline.','WooCommerce can accept both online and offline payments. <a href="%s" target="_blank">Additional payment methods</a> can be installed later.'=>'WooCommerce dapat menerima pembayaran online dan offline. <a href="%s" target="_blank">Metode pembayaran tambahan</a> bisa diinstal nanti.','PayPal email address:'=>'Alamat email PayPal:','Stripe email address'=>'Alamat email Stripe','Stripe email address:'=>'Alamat email Stripe:','Shipping Method'=>'Metode Pengiriman','Shipping Zone'=>'Zona Pengiriman','Don\'t charge for shipping.'=>'Tidak mengenakan ongkos kirim.','What would you like to charge for flat rate shipping?'=>'Berapa yang ingin Anda kenakan untuk tarif tetap pengiriman?','Set a fixed price to cover shipping costs.'=>'Tentukan harga tetap untuk menutup ongkos kirim.','Flat Rate'=>'Tarif Tetap','Jetpack'=>'Jetpack','I plan to sell both physical and digital products'=>'Saya berencana menjual produk fisik dan digital','I plan to sell digital products'=>'Saya berencana menjual produk digital','I plan to sell physical products'=>'Saya berencana menjual produk fisik','What type of products do you plan to sell?'=>'Jenis produk apa yang akan Anda jual?','The following wizard will help you configure your store and get you started quickly.'=>'Wizard berikut akan membantu Anda mengonfigurasi toko dan memulai dengan cepat.','Activate'=>'Aktifkan','Store setup'=>'Penyiapan toko','Terms and Conditions Page'=>'Halaman Syarat dan Ketentuan','My Account Page'=>'Halaman Akun Saya','Checkout Page'=>'Halaman Checkout','Cart Page'=>'Halaman Keranjang','Shop Page'=>'Halaman Toko','Coupon scheduled for: %s.'=>'Kupon terjadwal untuk: %s.','Order scheduled for: %s.'=>'Pesanan terjadwal untuk: %s.','Extensions %s'=>'Ekstensi %s','Enter a fixed amount or percentage to apply as a fee.'=>'Masukkan jumlah tetap atau persentase yang akan diter