 keranjang tetap" diterapkan.','Products that the coupon will not be applied to, or that cannot be in the cart in order for the "Fixed cart discount" to be applied.'=>'Produk yang kuponnya tidak akan diterapkan, atau tidak dapat dimasukkan ke dalam keranjang agar "Diskon keranjang tetap" diterapkan.','Products that the coupon will be applied to, or that need to be in the cart in order for the "Fixed cart discount" to be applied.'=>'Produk yang kuponnya akan diterapkan, atau yang perlu dimasukkan ke dalam keranjang agar "Diskon keranjang tetap" diterapkan.','Rated %1$s out of 5 based on %2$s customer rating'=>'Peringkat %1$s dari 5 berdasarkan %2$s penilaian pelanggan' . "\0" . 'Peringkat %1$s dari 5 berdasarkan %2$s penilaian pelanggan','Search results only'=>'Hanya menampilkan hasil pencarian','Shop only'=>'Hanya Toko','Shop and search results'=>'Hasil penelusuran dan toko','This order cannot be paid for. Please contact us if you need assistance.'=>'Pesanan ini tidak bisa dibayar. Silahkan hubungi kami jika anda membutuhkan bantuan.','Please log in to your account below to continue to the payment form.'=>'Silakan masuk ke akun Anda di bawah ini untuk melanjutkan ke formulir pembayaran.','No matching product exists to update.'=>'Tidak ada produk yang cocok untuk diperbarui.','A product with this SKU already exists.'=>'Produk dengan SKU ini sudah ada.','A product with this ID already exists.'=>'Produk dengan ID ini sudah ada.','SKU %s'=>'SKU %s','ID %d'=>'ID %d','Not able to attach "%s".'=>'Tidak bisa melampirkan "%s".','Variation cannot be imported: Missing parent ID or parent does not exist yet.'=>'Variasi tidak dapat diimpor: ID induk hilang atau belum ada.','Invalid product ID %d.'=>'ID produk %d tidak valid.','Invalid product type.'=>'Jenis produk tidak valid.','Subject (paid)'=>'Subjek (berbayar)','Available placeholders: %s'=>'Placeholder yang tersedia: %s','Invalid customer query.'=>'Permintaan pelanggan tidak valid.','Add New'=>'Tambah baru','All Products'=>'Semua produk','House number and street name'=>'Nomor rumah dan nama jalan','API Key generated successfully. Make sure to copy your new keys now as the secret key will be hidden once you leave this page.'=>'Kunci API berhasil dibuat. Pastikan untuk menyalin kunci baru Anda sekarang karena kunci rahasia akan disembunyikan begitu Anda meninggalkan halaman ini.','List of upsell products IDs.'=>'Daftar ID produk upsell.','The URL of your %s page (along with the Page ID).'=>'URL halaman %s Anda (bersama dengan ID Halaman).','The homepage URL of your site.'=>'URL beranda situs Anda.','Generate CSV'=>'Buat CSV','Yes, export all custom meta'=>'Ya, ekspor semua meta kustom','Export custom meta?'=>'Export custom meta?','Product variations'=>'Variasi produk','Export all products'=>'Ekspor semua produk','Which product types should be exported?'=>'Jenis produk mana yang harus diekspor?','Export all columns'=>'Ekspor semua kolom','Which columns should be exported?'=>'Kolom mana yang harus diekspor?','This tool allows you to generate and download a CSV file containing a list of all products.'=>'Alat ini memungkinkan Anda untuk membuat dan mengunduh file CSV yang terdiri dari daftar semua produk.','Export products to a CSV file'=>'Ekspor produk ke berkas CSV','Export Products'=>'Ekspor produk','Product restored'=>'Produk dipulihkan','Order restored'=>'Pesanan dipulihkan','Coupon restored'=>'Kupon dipulihkan','Locations not covered by your other zones'=>'Lokasi tidak tercakup oleh zone Anda lainnya.','Star ratings should be required, not optional'=>'Peringkat bintang semestinya wajib, bukan pilihan','Enable star rating on reviews'=>'Aktifkan rating bintang di ulasan','Reviews can only be left by "verified owners"'=>'Ulasan hanya dapat dibuat oleh "pemilik terverifikasi"','Enable product reviews'=>'Aktifkan ulasan produk','Set Status - Out of stock'=>'Atur Status - Kehabisan stok','Set Status - In stock'=>'Atur Status - Stok tersedia','Show advanced options'=>'Tampilkan opsi lanjutan','Hide advanced options'=>'Sembunyikan opsi lanjutan','CSV Delimiter'=>'Pembatas CSV','Alternatively, enter the path to a CSV file on your server:'=>'Atau, masukkan jalur ke berkas CSV di server Anda:','Update existing products'=>'Perbarui produk yang ada','Choose a CSV file from your computer:'=>'Pilih berkas CSV dari komputer Anda:','This tool allows you to import (or merge) product data to your store from a CSV or TXT file.'=>'Alat ini memungkinkan Anda untuk mengimpor (atau menggabungkan) data produk ke toko Anda dari file CSV atau TXT.','Your products are now being imported...'=>'Produk Anda sekarang sedang diimpor ...','Importing'=>'Sedang mengimpor','Run the importer'=>'Jalankan pengimpor','Do not import'=>'Jangan impor','Sample:'=>'Contoh:','Map to field'=>'Petakan ke bidang','Column name'=>'Nama kolom','Select fields from your CSV file to map against products fields, or to ignore during import.'=>'Pilih bidang dari file CSV Anda untuk memetakan bidang produk, atau untuk mengabaikannya saat mengimpor.','Map CSV fields to products'=>'Petakan bidang CSV ke produk','Import Products'=>'Impor Produk','Reason for failure'=>'Alasan kegagalan','Import complete!'=>'Impor selesai!','View import log'=>'Lihat log impor','Failed to import %s product'=>'Gagal untuk mengimpor %s produk' . "\0" . 'Gagal untuk mengimpor %s produk','%s product was skipped'=>'%s produk dilewati' . "\0" . '%s produk dilewati','%s product updated'=>'%s produk diperbarui' . "\0" . '%s produk diperbarui','%s product imported'=>'%s produk sudah diimpor' . "\0" . '%s produk sudah diimpor','Parent SKU'=>'SKU induk','Product Title'=>'Nama Produk','Default attribute'=>'Atribut standar','Attribute visibility'=>'Kenampakan atribut','Is a global attribute?'=>'Apakah atribut global?','Attribute value(s)'=>'Nilai Atribut','Attribute name'=>'Nama atribut','Download URL'=>'URL unduhan','Download name'=>'Nama unduhan','External product'=>'Produk eksternal','Quantity in stockStock'=>'Stok','Meta: %s'=>'Meta:%s','Download %d URL'=>'URL unduh %d','Download %d name'=>'Nama unduh %d','Attribute %d default'=>'Standar atribut %d','Attribute %d global'=>'Global atribut %d','Attribute %d visible'=>'Terlihat atribut %d','Attribute %d value(s)'=>'Nilai Atribut %d','Attribute %d name'=>'Nama atribut %d','External URL'=>'URL eksternal','Download expiry days'=>'Tanggal kedaluawarsa unduhan','Images'=>'Gambar-gambar','Allow customer reviews?'=>'Izinkan ulasan pelanggan?','Backorders allowed?'=>'Perbolehkan inden?','Date sale price ends'=>'Tanggal harga diskon berakhir','Date sale price starts'=>'Tanggal harga diskon dimulai','Short description'=>'Deskripsi singkat','Visibility in catalog'=>'Kenampakan pada katalog','Is featured?'=>'Apakah diunggulkan?','Published'=>'Telah Terbit','Invalid file type. The importer supports CSV and TXT file formats.'=>'Jenis berkas tidak valid. Pengimpor mendukung format berkas CSV dan TXT.','File is empty. Please upload something more substantial. This error could also be caused by uploads being disabled in your php.ini or by post_max_size being defined as smaller than upload_max_filesize in php.ini.'=>'File kosong. Silahkan upload sesuatu yang lebih substansial. Kesalahan ini juga bisa disebabkan oleh upload yang dinonaktifkan di php.ini atau oleh post_max_size yang didefinisikan lebih kecil dari upload_max_filesize di php.ini.','Done!'=>'Selesai!','Column mapping'=>'Pemetaan kolom','Upload CSV file'=>'Unggah berkas CSV','Browse Extensions'=>'Jelajahi Ekstensi','Disconnect'=>'Putuskan sambungan','My Subscriptions'=>'Langganan saya','Connected to WooCommerce.com'=>'Terhubung ke WooCommerce.com','Connect'=>'Sambung','Once connected, your WooCommerce.com purchases will be listed here.'=>'Setelah terhubung, pembelian WooCommerce.com Anda akan dicantumkan di sini.','Manage your subscriptions, get important product notifications, and updates, all from the convenience of your WooCommerce dashboard'=>'Kelola langganan Anda, dapatkan notifikasi produk penting, dan pembaruan, semuanya dari dasbor WooCommerce Anda','Installed Extensions without a Subscription'=>'Ekstensi terpasang tanpa berlangganan','Could not find any subscriptions on your WooCommerce.com account'=>'Tidak dapat menemukan langganan di akun WooCommerce.com Anda','Inactive'=>'Tidak Aktif','Upgrade'=>'Upgrade','Shared by %s'=>'Dibagikan oleh %s','Subscription: Unlimited'=>'Berlangganan: tidak terbatas','Subscription: Using %1$d of %2$d sites available'=>'Langganan: Menggunakan %1$d dari %2$d situs yang tersedia','Subscription: Not available - %1$d of %2$d already in use'=>'Berlangganan: Tidak tersedia - %1$d dari %2$d sudah digunakan','Expires on:'=>'Kedaluwarsa pada:','Expiring soon!'=>'Segera kedaluwarsa!','Auto renews on:'=>'Perpanjangan otomatis pada:','Expired :('=>'Kedaluwarsa :(','Subscriptions'=>'Berlangganan','WooCommerce Extensions'=>'Ekstensi WooCommerce','We\'ve made things simpler and easier to manage moving forward. From now on you can manage all your WooCommerce purchases directly from the Extensions menu within the WooCommerce plugin itself. <a href="%s">View and manage</a> your extensions now.'=>'Kami telah membuat segalanya lebih sederhana dan mudah dikelola. Mulai sekarang Anda dapat mengelola semua pembelian WooCommerce Anda langsung dari menu Ekstensi dalam plugin WooCommerce itu sendiri. <a href="%s">Lihat dan kelola</a> ekstensi Anda sekarang.','Looking for the WooCommerce Helper?'=>'Mencari bantuan WooCommerce?','Note: You currently have <a href="%1$s">%2$d paid extension</a> which should be updated first before updating WooCommerce.'=>'Catatan: Saat ini Anda memiliki <a href="%1$s">%2$d ekstensi</a> yang harus diperbarui dahulu sebelum memperbarui WooCommerce.' . "\0" . 'Catatan: Saat ini Anda memiliki <a href="%1$s">%2$d ekstensi</a> yang harus diperbarui dahulu sebelum memperbarui WooCommerce.','Authentication and subscription caches refreshed successfully.'=>'Cache autentikasi dan langganan berhasil diperbarui.','You have successfully disconnected your store from WooCommerce.com'=>'Anda berhasil memutuskan sambungan toko Anda dengan WooCommerce.com','You have successfully connected your store to WooCommerce.com'=>'Anda telah berhasil menghubungkan toko Anda ke WooCommerce.com','An error has occurred when deactivating the extension %1$s. Please proceed to the <a href="%2$s">Plugins screen</a> to deactivate it manually.'=>'Terjadi error saat menonaktifkan ekstensi %1$s. Silakan lanjutkan ke <a href="%2$s">layar Plugin</a> untuk menonaktifkannya secara manual.','The extension %s has been deactivated successfully.'=>'Ekstensi %s telah dinonaktifkan dengan sukses.','An error has occurred when deactivating the subscription for %s. Please try again later.'=>'Terjadi error saat menonaktifkan langganan untuk %s. Silakan coba lagi nanti.','Subscription for %1$s deactivated successfully. You will no longer receive updates for this product. <a href="%2$s">Click here</a> if you wish to deactivate the plugin as well.'=>'Langganan untuk %1$s berhasil dinonaktifkan. Anda tidak akan menerima pembaruan lagi untuk produk ini. <a href="%2$s">Klik di sini</a> jika Anda ingin menonaktifkan plugin juga.','Subscription for %s deactivated successfully. You will no longer receive updates for this product.'=>'Langganan untuk %s berhasil dinonaktifkan. Anda tidak akan menerima pembaruan lagi untuk produk ini.','An error has occurred when activating %s. Please try again later.'=>'Terjadi error saat mengaktifkan %s. Silakan coba lagi nanti.','%s activated successfully. You will now receive updates for this product.'=>'%s berhasil diaktifkan. Anda sekarang akan menerima pembaruan untuk produk ini.','Version %s is <strong>available</strong>. To enable this update you need to <strong>purchase</strong> a new subscription.'=>'Versi %s telah tersedia. Untuk mengaktifkan pembaruan ini, Anda perlu <strong>membeli</strong> langganan yang baru.','This subscription is expiring soon. Please <strong>renew</strong> to continue receivi