atur jumlah angka desimal yang ditampilkan di harga yang ditampilkan.','Number of decimals.'=>'Jumlah desimal.','This sets the decimal separator of displayed prices.'=>'Ini mengatur pemisah desimal dari harga yang ditampilkan.','This sets the thousand separator of displayed prices.'=>'Ini mengatur pemisah ribuan dari harga yang ditampilkan.','This controls the position of the currency symbol.'=>'Ini mengontrol posisi simbol mata uang.','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Ini mengontrol harga mata uang apa yang tercantum dalam katalog dan gateway mata uang mana yang akan menerima pembayaran.','Currency'=>'Mata uang','The following options affect how prices are displayed on the frontend.'=>'Pilihan berikut ini mempengaruhi cara harga ditampilkan di front-end.','Currency options'=>'Pilihan Mata Uang','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'Ini merupakan demo toko untuk keperluan percobaan &mdash; tidak ada pesanan yang akan diproses.','Store notice'=>'Pemberitahuan Toko','Geolocate (with page caching support)'=>'Geolokasi (dengan dukungan cache halaman)','Geolocate'=>'Geolokasi','Shop base address'=>'Alamat basis toko','IP address'=>'Alamat IP','Specific Countries'=>'Negara Tertentu','Sell to all countries'=>'Jual ke semua negara','This option lets you limit which countries you are willing to sell to.'=>'Pilihan ini memungkinkan Anda membatasi ke negara mana saja penjualan Anda.','Selling location(s)'=>'Lokasi penjualan','Background color'=>'Warna latar belakang','Base color'=>'Warna dasar','The text to appear in the footer of all WooCommerce emails.'=>'Teks yang akan muncul di footer dari semua email WooCommerce.','Header image'=>'Gambar tajuk','Email template'=>'Template email','"From" name'=>'Nama "Dari"','Email sender options'=>'Pilihan pengirim email','Email options'=>'Pilihan email','Emails'=>'Email','Endpoint for the "Checkout &rarr; Add